import{_ as e,o as a,c as i,Q as o}from"./chunks/framework.cfbd61a4.js";const r="/personalblog2/assets/qq.199fa02b.jpg",t="/personalblog2/assets/wx.ac0f885e.jpg",m=JSON.parse('{"title":"文档指南","description":"","frontmatter":{},"headers":[],"relativePath":"guide/my.md","filePath":"guide/my.md","lastUpdated":null}'),l={name:"guide/my.md"},c=o('<h1 id="文档指南" tabindex="-1">文档指南 <a class="header-anchor" href="#文档指南" aria-label="Permalink to &quot;文档指南&quot;">​</a></h1><h2 id="一、介绍" tabindex="-1">一、介绍 <a class="header-anchor" href="#一、介绍" aria-label="Permalink to &quot;一、介绍&quot;">​</a></h2><ul><li><p>本文档是用于学习前端开发的初学者分享的一份学习路线、知识点讲解。让你从小白入门，到企业中进行工作，文档是基于VuePress编写，笔者由于时间和精力有限，如果文档存在不足的地方，请多多指导！</p></li><li><p>您可以联系本人的QQ，微信，邮箱。</p></li></ul><p><code>QQ：</code></p><p><img src="'+r+'" alt="qq:2807747262"></p><p><code>微信：</code></p><p><img src="'+t+'" alt="wx:2807747262"></p><p><code>邮箱：</code> <a href="https://mail.qq.com/" target="_blank" rel="noreferrer">2807747262@qq.com</a></p><h2 id="二、前端学习路线" tabindex="-1">二、前端学习路线 <a class="header-anchor" href="#二、前端学习路线" aria-label="Permalink to &quot;二、前端学习路线&quot;">​</a></h2><h2 id="_1、基础知识" tabindex="-1">1、基础知识 <a class="header-anchor" href="#_1、基础知识" aria-label="Permalink to &quot;1、基础知识&quot;">​</a></h2><p>基础知识包含学习：HTML、CSS、HTML5、CSS3，建议学习的时间在15天左右，学习完之后建议做以下几个练习，巩固基础知识：</p><ul><li>京东图片列表</li><li>京东左侧导航条</li><li>网易新闻列表</li><li>京东轮播图</li><li>电影卡片</li><li>小米商城首页、详情页、购物车</li></ul><p>推荐视频学习地址：<a href="https://www.bilibili.com/video/BV1p84y1P7Z5/" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1p84y1P7Z5/</a></p><h2 id="_2、bootstrap" tabindex="-1">2、Bootstrap <a class="header-anchor" href="#_2、bootstrap" aria-label="Permalink to &quot;2、Bootstrap&quot;">​</a></h2><p>Bootstrap 让前端开发更快速、简单。所有开发者都能快速上手、所有设备都可以适配、所有项目都适用。Bootstrap 的源码是采用最流行的 CSS 预处理工具 Less 和 Sass 开发的。你的网站和应用能在 Bootstrap 的帮助下通过同一份源码快速、有效地适配手机、平板和 PC 设备，这一切都是 CSS 媒体查询（Media Query）的功劳。建议学习时间2天。</p><p>学习完之后建议练习：</p><p>推荐视频学习地址：<a href="https://www.bilibili.com/video/BV1YW411T7yy" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1YW411T7yy</a></p><h2 id="_3、javascript" tabindex="-1">3、JavaScript <a class="header-anchor" href="#_3、javascript" aria-label="Permalink to &quot;3、JavaScript&quot;">​</a></h2><p>JavaScript是包含JavaScript基础和JavaScript高级。</p><p>JavaScript基础需要掌握ES标准、BOM以及DOM等内容，适合有一定HTML和CSS基础的同学学习。</p><p>JavaScript高级主要指掌握原型链、原型、面向对象编程、深拷贝、浅拷贝、事件轮询、闭包、作用域链等知识。</p><p>建议学习时间30天-40天。</p><p>学习完之后建议练习：</p><ul><li>随机图片</li><li>表单验证提交</li><li>选择放大与缩小</li><li>手风琴</li><li>九九乘法表</li><li>轮播图</li><li>选项卡</li></ul><p>30个小练习地址：<a href="https://github.com/wesbos/JavaScript30.git" target="_blank" rel="noreferrer">https://github.com/wesbos/JavaScript30.git</a></p><p>推荐视频学习地址(基础)：<a href="https://www.bilibili.com/video/BV1YW411T7GX" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1YW411T7GX</a></p><p>推荐视频学习地址(高级)：<a href="https://www.bilibili.com/video/BV14s411E7qf" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV14s411E7qf</a></p><h2 id="_4、jquery" tabindex="-1">4、jQuery <a class="header-anchor" href="#_4、jquery" aria-label="Permalink to &quot;4、jQuery&quot;">​</a></h2><p>jQuery是使用广泛的JS函数库， 它能帮我们程序员简化DOM查询及DOM操作， 轻松实现动画效果。虽然现在不被广泛使用了，但是由于之前很多的项目都是基于jQuery做的，所以还是需要简单的学习一下它的Api。推荐学习时间1天。</p><p>推荐视频学习地址：<a href="https://www.bilibili.com/video/BV1ts411E7ag" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1ts411E7ag</a></p><h2 id="_5、es6" tabindex="-1">5、ES6+ <a class="header-anchor" href="#_5、es6" aria-label="Permalink to &quot;5、ES6+&quot;">​</a></h2><p><code>ECMAScript</code> 6.0（以下简称<code>ES6</code>）是<code>JavaScript</code>语言的下一代标准，已经在2015年6月正式发布了。它的目标，是使得<code>JavaScript</code>语言可以用来编写复杂的大型应用程序，成为企业级开发语言。在工作中使用的很多语法都是属于<code>ES6+</code>的，由于其简便，所以广受开发者的喜爱。这里注意，<code>ES6+</code>并不是需要你学习一门新的语言，ES是<code>ECMAScript</code>的简称，而<code>ECMAScript</code>和<code>JavaScript</code>的关系是，前者是后者的规格，后者是前者的一种实现（另外的<code>ECMAScript</code>方言还有<code>Jscript</code>和<code>ActionScript</code>）。日常场合，这两个词是可以互换的。</p><p>推荐视频学习地址：<a href="https://www.bilibili.com/video/BV1uK411H7on" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1uK411H7on</a></p><p>注意：Promise也是ES6的新特性，这里需要单独学习，因为其是非常重要的一个模块。</p><p>Promise视频学习地址推荐：<a href="https://www.bilibili.com/video/BV1GA411x7z1" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1GA411x7z1</a></p><h2 id="_6、js模块化" tabindex="-1">6、JS模块化 <a class="header-anchor" href="#_6、js模块化" aria-label="Permalink to &quot;6、JS模块化&quot;">​</a></h2><p>当项目功能越来越多，代码量便也会越来越多，后期的维护难度会增大，此时在JS方面就会考虑使用模块化规范去管理。模块化是为了我们更好的帮助我们开发企业级项目，由于企业级项目它的项目体系很大，所以我们需要考虑到复用性和可阅读性，往往我们会才去模块化的方式进行开发。</p><p>推荐视频学习地址：<a href="https://www.bilibili.com/video/BV18s411E7Tj" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV18s411E7Tj</a></p><h2 id="_7、nodejs" tabindex="-1">7、NodeJS <a class="header-anchor" href="#_7、nodejs" aria-label="Permalink to &quot;7、NodeJS&quot;">​</a></h2><p>Node.js是一个能够在服务器端运行JavaScript的开放源代码、是一个跨平台JavaScript运行环境。也就是说NodeJS是通过JavaScript编写，并且能够运行在服务器的语言。</p><p>推荐视频学习地址：<a href="https://www.bilibili.com/video/BV1bs411E7pD" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1bs411E7pD</a></p><h2 id="_8、ajax" tabindex="-1">8、Ajax <a class="header-anchor" href="#_8、ajax" aria-label="Permalink to &quot;8、Ajax&quot;">​</a></h2><p>Ajax 即“Asynchronous Javascript And XML”（异步 JavaScript 和 XML），是指⼀种创建交互式⽹⻚应⽤的⽹⻚开发技术。</p><p>Ajax 是⼀种在⽆需重新加载整个⽹⻚的情况下，能够更新部分⽹⻚的技术。</p><p>通过在后台与服务器进⾏少量数据交换，Ajax 可以使⽹⻚实现异步更新。这意味着可以在不重新加载整个⽹⻚的情况下，对⽹⻚的某部分进⾏更新。</p><p>传统的⽹⻚（不使⽤ Ajax）如果需要更新内容，必须重载整个⽹⻚⻚⾯。</p><p>推荐视频学习地址：<a href="https://www.bilibili.com/video/BV1WC4y1b78y" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1WC4y1b78y</a></p><h2 id="_9、axios" tabindex="-1">9、Axios <a class="header-anchor" href="#_9、axios" aria-label="Permalink to &quot;9、Axios&quot;">​</a></h2><p>axios是一个基于Promise的HTTP客户端，可以用在浏览器和node.js中，向服务器发送AJAX请求进行数据交换，是现在前端炙手可热的请求工具。</p><p>推荐视频学习地址：<a href="https://www.bilibili.com/video/BV1NJ41197u6" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1NJ41197u6</a></p><h2 id="_10、git" tabindex="-1">10、Git <a class="header-anchor" href="#_10、git" aria-label="Permalink to &quot;10、Git&quot;">​</a></h2><p>Git 是一个开源的分布式版本控制系统，用以有效、高速的处理从很小到非常大的项目版本管理。</p><p>推荐视频学习地址：<a href="https://www.bilibili.com/video/BV1NJ41197u6" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1NJ41197u6</a></p><p style="background:#20D5FE;"> 学习完以上的教程，恭喜你就可以进入框架的学习了，框架是为了我们开发流程更加规范，更加简便，更加哦高效，更加性能的技术，其基础还是基于HTML、CSS、JavaScript这三大基础。因此，学习到这里，笔者希望你已经掌握好了这些技术。 </p><h2 id="_11、react全家桶" tabindex="-1">11、React全家桶 <a class="header-anchor" href="#_11、react全家桶" aria-label="Permalink to &quot;11、React全家桶&quot;">​</a></h2><p><code>React</code> 是 <code>Facebook</code> 开发的一款 <code>JavaScript</code> 库，而 <code>React</code> 被建造是因为 <code>Facebook</code> 认为市场上所有的 <code>JavaScript</code> <code>MVC</code> 框架都不能满足他们的扩展需求， 由于他们非常巨大的代码库和庞大的组织，使得 <code>MVC</code> 很快变得非常复复杂，每当需要添加一项新的功能或特性时，系统的复杂度就成级数增长，致使代码变得脆弱和不可预测，结果导致他们的 <code>MVC</code> 正在土崩瓦解。2011 年 <code>Facebook</code> 软件工程师 <code>Jordan Walke</code> 创建了 <code>React</code> ，并且首次使用 <code>Facebook</code> 的 <code>Newsfeed</code> 功能。做出来以后，发现这套东西很好用，就在 2013 年 5 月开源了。</p><p>推荐视频学习地址：<a href="https://www.bilibili.com/video/BV1wy4y1D7JT" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1wy4y1D7JT</a></p><h2 id="_12、vue全家桶" tabindex="-1">12、Vue全家桶 <a class="header-anchor" href="#_12、vue全家桶" aria-label="Permalink to &quot;12、Vue全家桶&quot;">​</a></h2><p><code>Vue</code>是有大神尤雨溪团队进行开发的一款<code>JavaScript库</code>，它是大多数开发者喜爱的一种开源框架，由于其封装较多，所以用起来相对<code>React而言简单</code>，且上手容易。</p><p>推荐视频学习地址：<a href="https://www.bilibili.com/video/BV1Zy4y1K7SH" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1Zy4y1K7SH</a></p><p style="background:#20D5FE;"> 最后恭喜你已经具备了可以去企业开发的能力，但是还是需要你多练，多写。并且学习完以上知识能够做一两个企业级的项目。项目非常的多，笔者建议去b站跟着视频做一个自己喜欢的企业级的项目。 </p>',61),p=[c];function d(s,h,b,n,w,_){return a(),i("div",null,p)}const f=e(l,[["render",d]]);export{m as __pageData,f as default};
